To start the runtime provide a template, a data context and finally a closure: let runtime = Runtime::<()>::new();
let template = std::fs::read_to_string("template.tiny")?;
runtime.start(template, DataCtx::empty(), |event, root_widget, data_ctx, sender| {
}); The closure is called every time there is an event available. Event<T> can be anything from a key press to a user defined type sent via the sender. The root_widget is the root of the widget tree. For information on how to manipulate the widget tree see widgets , and the data_ctx contains all the template variables that can be used inside the template.

