} impl UserModel for Model { type Message = (); fn event(&mut self, event: Event<Self::Message>, root: &mut WidgetContainer) { if event.ctrl_c() { self.tx.send(Event::Quit).unwrap(); } } fn data(&mut self) -> &mut DataCtx { &mut self.data }
}

